YUI.add('srpl-business-templates', function(Y){
// DO NOT EDIT THIS FILE
// this should be automatically generated by using the .*.html files in templates
Y.namespace('srpl.Business');
Y.srpl.Business.templates = {
    description:Y.template('<% if (b.get(\'description\')) { %>\n<div class="srpl-container">\n    <h3><%= Y.srpl.util.stringTruncator(b.get(\'description\'),Y.srpl.config(\'business.descriptionLimit\')) %></h3>\n</div>\n<% }%>'),
		details:Y.template('<div class="srpl-container srpl-detail-container">\n    <div class="srpl-container-body">\n        <% if (b.get(\'hours\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Hours</div>\n            <div class="yui3-u-3-4">\n                <%\n                Y.each(b.get(\'hours\').days,function(d,i){\n                %>\n                <p class="<%= (i > Y.srpl.config(\'business.hourLimit\')) ? \'hide\' : \'\' %>"><%= d.desc %></p>\n                <%\n                });\n                %>\n            </div>\n        </div>\n        <% } if (b.get(\'categories\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Category</div>\n            <div class="yui3-u-3-4">\n            <%\n                Y.each(b.get(\'categories\'),function(c,i){%>\n                <a target="<%= Y.srpl.config(\'linking.target\') %>" href="<%= c.url %>" title="<%= c.name %>"><%= c.name %></a><%= (i === b.get(\'categories\').length-1 || i === 0) ? \'\' : \', \' %>\n            <%});%>\n            </div>\n        </div>\n        <% } if (b.get(\'payment\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Payment</div>\n            <div class="yui3-u-3-4"><%= b.get(\'payment\') %></div>\n        </div>\n        <% } if (b.get(\'cuisine\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Cuisine</div>\n            <div class="yui3-u-3-4"><%= b.get(\'cuisine\') %></div>\n        </div>\n        <% } if (b.get(\'ambiance\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Ambiance</div>\n            <div class="yui3-u-3-4"><%= b.get(\'ambiance\') %></div>\n        </div>\n        <% } if (b.get(\'feature\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Feature</div>\n            <div class="yui3-u-3-4"><%= b.get(\'feature\') %></div>\n        </div>\n        <% } if (b.get(\'attire\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Attire</div>\n            <div class="yui3-u-3-4"><%= b.get(\'attire\') %></div>\n        </div>\n        <% } if (b.get(\'price\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Price</div>\n            <div class="yui3-u-3-4"><%= b.get(\'price\') %></div>\n        </div>\n        <% } %>\n        <ul class="srpl-actions clearfix">\n            <li class="first-child srpl-more-details" style="display:none">\n                <a href="<%= b.getBusinessUrl() %>" class="f-left" title="View More Details">View More Details</a>\n            </li>\n            <li class="last-child f-right">\n                <a href="<%= b.getBusinessUrl() %>" class="f-right" title="Suggest an edit">Suggest an edit</a>\n            <li>\n        </ul>\n    </div>\n</div>'),
		full:Y.template('<div class="srpl-header yui3-g">\n    <div class="srpl-hero-container yui3-u-17-24 column1">\n        <%= Y.srpl.Business.templates.hero_container({b:b,r:r,h:h}) %>\n    </div>\n    <div class="srpl-map yui3-u-7-24 column2"></div>\n</div>\n<div class="srpl-body yui3-g">\n    <div class="yui3-u-17-24 column1">\n        <%= Y.srpl.Business.templates.description({b:b}) %>\n        <%= Y.srpl.Business.templates.gallery({b:b}) %>\n        <div class="srpl-container srpl-foursquare" style="display:none;"></div>\n        <div class="srpl-container srpl-yelp-reviews" style="display:none;"></div>\n        <div class="srpl-container srpl-yahoo-reviews" style="display:none;"></div>\n    </div>\n    <div class="yui3-u-7-24 column2">\n        <%= Y.srpl.Business.templates.details({b:b}) %>\n    </div>\n</div>'),
		gallery:Y.template('<% \n    var photos = b.getThumbnailGalleryPhotos();\n    if (photos.length > 0) { %>\n    <div class="srpl-container srpl-gallery">\n        <div class="srpl-container-body">\n            <ul class="clearfix">\n            <%\n            photos = photos.slice(0,Y.srpl.config(\'business.galleryCount\'));\n            Y.each(photos, function(p,i){ %>\n                <li class="<%=(i===0) ? \'first-child\' : \'\'%> <%=(i===(photos.length-1)) ? \'last-child\' : \'\'%> srpl-gallery-thumbnails">\n                    <img src="<%= p %>" alt="<%= b.displayValue() %>"/>\n                </li>\n            <%}); %>\n            </ul>\n            <ul class="srpl-actions clearfix">\n                <li class="first-child">\n                    <a href="<%=b.getBusinessUrl()%>" title="Add Photos">Add Photos</a>\n                </li>\n            </ul>\n        </div>\n    </div>\n<% }%>'),
		hero_actions:Y.template('<ul class="srpl-actions clearfix">\n    <li class="first-child">\n        <button style="background-color:<%= h.get(\'palette\').button %>;color:<%= h.get(\'palette\').text %>" title="Send to phone" type="button" class="send-phone transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Send to phone</div>\n       </button>\n    </li>\n    <li>\n        <button style="background-color:<%= h.get(\'palette\').button %>;color:<%= h.get(\'palette\').text %>" title="Directions" type="button" class="srpl-directions transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Directions</div>\n       </button>\n    </li>\n    <li>\n        <button style="background-color:<%= h.get(\'palette\').button %>;color:<%= h.get(\'palette\').text %>" title="Share" type="button" class="share transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Share</div>\n       </button>\n    </li>\n    <li class="last-child">\n        <button style="background-color:<%= h.get(\'palette\').button %>;color:<%= h.get(\'palette\').text %>" title="Menu" type="button" class="menu transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Menu</div>\n       </button>\n    </li>\n</ul>'),
		hero_container:Y.template('<div class="srcpl-hero-container" style="color:<%= h.get(\'palette\').text %>">\n    <img class="hero" src="<%= h.get(\'image\').src %>" alt="<%= b.get(\'title\') %>" height="<%= h.get(\'image\').height %>" width="<%= h.get(\'image\').width %>" />\n    <div class="srcpl-hero-content-container">\n        <h1><%= b.get(\'title\') %></h1>\n        <h2><%= b.get(\'primary_category\') %></h2>\n        <% if (r.get(\'averageRating\') && !isNaN(r.get(\'averageRating\'))) { %>\n        <p class="srpl-rating-review">\n            <a target="_blank" href="<%= r.get(\'reviewUrl\') %>">\n                <span class="srpl-rating-static f-left srpl-rating-<%= (r.get(\'averageRating\')*10) %>">\n                    <%= r.get(\'averageRating\') %> out of 5 stars\n                </span>\n                <span class="srpl-review"><%= r.get(\'reviewCount\') %> reviews on <%= r.get(\'source\') %></span>\n            </a>\n        </p>\n        <% } if (b.get(\'address\')) {%>\n        <p class="adr"><%= b.get(\'address\') %></p>\n        <% } if (b.get(\'phone\')) {%>\n        <p class="tel"><%= b.get(\'phone\') %></p>\n        <% } if (b.get(\'website\') && b.get(\'website\').url) {%>\n        <p class="web">\n            <a href="<%= b.get(\'website\').url %>" target="_blank" class="url" title="<%= b.get(\'website\').label %>">\n                <%= b.get(\'website\').label %>\n            </a>\n        </p>\n        <% } %>\n        <%= Y.srpl.Business.templates.hero_actions({h:h}) %>\n    </div>\n</div>')
};
}, '@VERSION@',{
    // [bug 5892107] no need to require assets     
    requires:['srpl-template']
});